import styles from "./footer.scss";

const Footer = () => (
  <div className={styles}>
    <footer className="footer">
      <ul className="footer-items">
        <li>Github</li>
        <li>LinkedIn</li>
      </ul>
    </footer>
  </div>
);
export default Footer;
